@notice Adds liquidity to the pool of a token pair.
@dev Make sure to approve the tokens to be transferred by this contract before invoking.
Steps:
1. Identifies the pool index based on the token pair.
2. Distributes tokens to liquidity clusters.
3. Mints LP tokens in a manner proportional to the added liquidity.
Reverts if:
- The pool for the token pair does not exist.
- The amount to be minted falls below the minimum liquidity threshold.
Emits:
- LiquidityAdded event with details of the liquidity addition.
@param tokenA The first token in the liquidity pool pair.
@param tokenB The second token in the liquidity pool pair.
@param amountA The amount of tokenA to add to the liquidity pool.
@param amountB The amount of tokenB to add to the liquidity pool.
@param provider The address that will receive the minted LP tokens.

@notice Redeems LP tokens to withdraw underlying assets from the liquidity pool.
@dev This function burns LP tokens and transfers the corresponding underlying assets to the recipient.
Steps:
1. Validate the amount of LP tokens to be redeemed.
2. Identify the pool index using the tokens in the LP token.
3. Calculate the redeemable amount of each underlying asset.
4. Burn the provided amount of LP tokens.
5. Transfer the underlying assets to the recipient.
Reverts if:
- The specified amount of LP tokens is zero.
- The specified amount of LP tokens exceeds the contract's balance.
Emits:
- LiquidityRedeemed event with details of the redemption.
@param lpToken The LP token to be redeemed.
@param amountLpTokens The amount of LP tokens to redeem.
@param recipient The address to receive the redeemed underlying assets.
@return thisOut The redeemed amount of the first underlying asset.
@return thatOut The redeemed amount of the second underlying asset.

